(17, 'DSWD Promotes the Rights and Privileges of Persons with Disabilities', 8, '<div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; overflow-wrap: break-word; white-space-collapse: preserve; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">The Department of Social Welfare and Development (DSWD) reiterates Section 6 of RA 10754 or the \"An Act Expanding the Benefits and Privileges of Persons with Disability,\" wherein “Persons with disability shall be entitled to the <span style=\"font-family: inherit;\"><a tabindex=\"-1\" style=\"color: rgb(56, 88, 152); cursor: pointer; font-family: inherit;\"></a></span>grant of 20% discount and VAT-exemption on the purchase of certain goods and services from all establishments under RA 9442 for their exclusive use, enjoyment or availment. Provided, however, that the purchase of such goods and services from sellers that are not subject to Value Added Tax (VAT) shall be subject to the applicable percentage tax.”</div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; overflow-wrap: break-word; white-space-collapse: preserve; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; color: rgb(5, 5, 5); font-size: 15px;\"><div dir=\"auto\" style=\"font-family: inherit;\">For the filing of complaints and other inquiries, you may get in touch with the Persons with Disability Affairs Office (PDAO) under the local government units (LGUs) or the National Council on Disability Affairs (NCDA) through the following:</div></div><div class=\"x11i5rnm xat24cr x1mh8g0r x1vvkbs xtlvy1s x126k92a\" style=\"margin: 0.5em 0px 0px; overflow-wrap: break-word; white-space-collapse: preserve; font-family: &quot;Segoe UI Historic&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif